style.css:
@-moz-document url-prefix("https://planbserver.com/forum/") {
/*Search input at the top*/
.search_input{
    color:white !important;
    background:#484848 !important;
}

body{
    background:black !important;
}
/* THREADS */
.core_posts .content .floatleft *,.moderatorbar *,.keyinfo div,.quickbuttons *,.post_wrapper li{
    color:#DFDEDE !important; 
}
.bbc_standard_quote{
    background:#545454 !important;
    color:white !important;
}
.bbc_alternate_quote{
    background:#424242 !important;
    color:white !important;
    
}

.topslice,.botslice, .topslice *,.botslice *{
    background:#DFDEDE !important;
    
}
.pagelinks {
    color:#DFDEDE !important;
    
}
.navPages{
    color:#89B1BF !important;
}
.post_wrapper,.postarea,.poster{
    background:#272822  !important;
}
/*LIST*/
#topbar{
    background:#484848 !important;
}
#main_content{
    background:#272822 !important;
}
/*Table of threads*/
td.subject,td.stats,td.lastpost,td.info{
    background:#454545 !important;
}
td.subject p {
    color:white !important;
}
td.subject p a ,td.lastpost a,.pagelinks .navPages,.pagelinks *,.pagesection{
    color:#2DBEE8 !important;
}
td.info a{
        color:#ff9d88 !important;
}
.subject_title *{
    color:#ff9e89 !important;
}
td.stats *,td.stats,td.stats > *,td.lastpost{
    color:#ccc !important;
}
td.icon2,td.icon{
    background:#808080 !important;
}
/*CopyRight at the bottom*/
.ds_copyright,.ds_copyright li a span{
    color:#ff9e89 !important;
    
}

/*Navigate section at the bottom( after pages) and at the top*/
.navigate_section *{
    color:#2DBEE8 !important;
}
/*Home page Info center*/
.roundframe,.lowerframe,.lowerframe span{
        background:#3B3B3B !important;

}
.roundframe p,.topslice_quote a,table.calendar_table td a,table.table_grid td a:not(span.subject_title){
        color:#2DBEE8 !important;

}
span.birthday{
   color:#f3a9f4 !important;
    
}
#posting_icons *{
    color:white !important;
}
span.clear,span.clear *,span.upperframe,span.upperframe *,.content,span.botslice *,span.botslice,span.topslice,span.topslice *,div.windowbg,div.windowbg2{
        background:#272822 !important;
    
}

 #search_options , #advanced_search span{
    color:#DFDEDE !important;
}
input,select {
    color:black !important;
}
div.content,div.signature *,div.username *,.postarea,.poster li,.postarea h5,.windowbg2 label,.windowbg2 span{
    color:#DFDEDE !important;
}
#admin_menu *,.table_list .children *{
    color:#DFDEDE !important;
    
}
dl a,.table_list .children a,.keyinfo a,.bbc_link,#help_container a,#upshrinkHeaderIC a{
        color:#2DBEE8 !important; 
}
.table_list td.children{
        background:#3B3B3B !important;
    
}

dd input *, dd textarea{
    color:black !important;
}
input + label,td.info p{
        color:#DFDEDE !important;
}
.calendar_table td,.table_grid td{
            background:#3B3B3B !important;

}
.calendar_table td,.table_grid td{
    border: 1px solid white !important;
    color:white !important;
    border-collapse:collapse !important;
}
#help_container p,#help_container li{
    color:white !important;
    
    }
#bottom_r{
            background:#3B3B3B !important;
}
.poster h4 a{
        color:#ff9d88 !important;
}
dl#post_header span.caption_subject,dl#post_header dt,#upshrinkHeaderIC p{
    color:#DFDEDE !important;
}
#personal_messages .table_grid td  a,.calendar_table a,#mlist td a{
        color:#2DBEE8 !important; 

}
td.stickybg,td.stickybg2{
    background:#0c6185 !important;
}
td.lockedbg,td.lockedbg2{
   background:#003051 !important; 
}
.topslice_quote a{
        color:#06ff00 !important; 
    
}
}
